"use strict";
class ConductorDbModel {
    constructor(id, idConductor, Lat, Log, Estado, IdPedido, SubServicio, bandera) {
        this.id = id;
        this.idConductor = idConductor;
        this.Lat = Lat;
        this.Log = Log;
        this.Estado = Estado;
        this.IdPedido = IdPedido;
        this.SubServicio = SubServicio;
        this.bandera = bandera;
    }
}
